import ProjectList from '../components/ProjectList'
import useFetch from '../hooks/useFetch'
import { useParams } from "react-router-dom";
import { useNavigate } from 'react-router-dom';



const View = () => {
        const {username} = useParams();
        const{username:check} = useFetch('api/users');
        console.log(check.filter((user) => user.username === userna))
        const navigate = useNavigate()
        if(!check) {
            navigate('/NotFound')
        }
        const {data: projects, isPending, errorMessage} = useFetch('/api/projects');
        const title = username + "'s Projects"

        return ( 
            <div className="home">
                {errorMessage && <div>{errorMessage}</div>}
                {isPending && <div>Loading...</div>}
                {projects && <ProjectList projects={projects.filter((project) => project.username === username)} title={title}  />}
            </div>


         );
    }

export default View;
